import React from 'react'
import { Box, Typography } from '@mui/material'
import "./NavBar.css"

const NavBar = () => {
  return (
    <Box className="NavBar_body">
        <Typography sx={{fontSize:"32px",boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.1)"}}>COZ Shopping</Typography>
    </Box>
  )
}

export default NavBar
